import Link from "next/link";

const Navigation = () => {
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Index</a>
        </Link>
      </li>
      <li>Services</li>
      <li>About</li>
    </ul>
  );
};

export default Navigation;
